import React, {Component} from "react"
import Particles from "react-particles-js";

class Secondary extends Component {
  render() {
    return (
      <div className="particle">
        <Particles
          params={{
          particles: { 
              onHover: {
                enable: true,
                mode: 'repulse'
            },
            number: { 
              value: 125, 
              density: { 
                enable: true, 
                value_area: 1000,
              } 
            }, 
          }, 

          }}
        />
        />
      </div>
    );
  }
}

export default Secondary
